/// <reference path="ColorPattern.ts"/>

class ColorPatterns {
	public static White: ColorPattern;
	public static Black: ColorPattern;
	public static Grey: ColorPattern;
	public static Red: ColorPattern;
	public static Blue: ColorPattern;
	public static Green: ColorPattern;
	public static FrameColor: ColorPattern;

	public static initialize() {
		if (!ColorPatterns.White) ColorPatterns.loadWhite();
		if (!ColorPatterns.Black) ColorPatterns.loadBlack();
		if (!ColorPatterns.Grey) ColorPatterns.loadGrey();
		if (!ColorPatterns.Red) ColorPatterns.loadRed();
		if (!ColorPatterns.Blue) ColorPatterns.loadBlue();
		if (!ColorPatterns.Green) ColorPatterns.loadGreen();
		if (!ColorPatterns.FrameColor) ColorPatterns.loadFrameColor();
	}

	public static allPatternsAreLoaded(): boolean {
		return ColorPatterns.White.loaded &&
			ColorPatterns.Black.loaded &&
			ColorPatterns.Grey.loaded &&
			ColorPatterns.Red.loaded &&
			ColorPatterns.Blue.loaded &&
			ColorPatterns.Green.loaded &&
			ColorPatterns.FrameColor.loaded;
	}

	private static loadWhite(): void {
		ColorPatterns.White = { image: new Image(), loaded: false };
		ColorPatterns.White.image.onload = function() {
			ColorPatterns.White.loaded = true;
		};

		ColorPatterns.White.image.src = "data:image/png;base64,";
	}

	private static loadBlack(): void {
		ColorPatterns.Black = { image: new Image(), loaded: false };
		ColorPatterns.Black.image.onload = function() {
			ColorPatterns.Black.loaded = true;
		};

		ColorPatterns.Black.image.src = "data:image/png;base64,";
	}

	private static loadGrey(): void {
		ColorPatterns.Grey = { image: new Image(), loaded: false };
		ColorPatterns.Grey.image.onload = function() {
			ColorPatterns.Grey.loaded = true;
		};

		ColorPatterns.Grey.image.src = "data:image/png;base64,";
	}

	private static loadRed(): void {
		ColorPatterns.Red = { image: new Image(), loaded: false };
		ColorPatterns.Red.image.onload = function() {
			ColorPatterns.Red.loaded = true;
		};

		ColorPatterns.Red.image.src = "data:image/png;base64,";
	}

	private static loadBlue(): void {
		ColorPatterns.Blue = { image: new Image(), loaded: false };
		ColorPatterns.Blue.image.onload = function() {
			ColorPatterns.Blue.loaded = true;
		};

		ColorPatterns.Blue.image.src = "data:image/png;base64,";
	}

	private static loadGreen(): void {
		ColorPatterns.Green = { image: new Image(), loaded: false };
		ColorPatterns.Green.image.onload = function() {
			ColorPatterns.Green.loaded = true;
		};

		ColorPatterns.Green.image.src = "data:image/png;base64,";
	}

	private static loadFrameColor(): void {
		ColorPatterns.FrameColor = { image: new Image(), loaded: false };
		ColorPatterns.FrameColor.image.onload = function() {
			ColorPatterns.FrameColor.loaded = true;
		};

		ColorPatterns.FrameColor.image.src = "data:image/png;base64,";
	}
}